def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros(len(bins))

    for i in range(len(bins)):
        if ratios[i] > 1.2:
            priorities[i] = 10
        elif ratios[i] > 1.1:
            if item > 25 and bins[i] > 20:
                priorities[i] = 9
            elif item > 20 and bins[i] > 15:
                priorities[i] = 8
            else:
                priorities[i] = 7
        elif ratios[i] > 1.0:
            if item > 18 and bins[i] > 12:
                priorities[i] = 7
            elif item > 15 and bins[i] > 10:
                priorities[i] = 6
            else:
                priorities[i] = 5
        elif ratios[i] > 0.9:
            if item > 12 and bins[i] > 8:
                priorities[i] = 6
            elif item > 10 and bins[i] > 6:
                priorities[i] = 5
            else:
                priorities[i] = 4
        elif ratios[i] > 0.8:
            if item > 8 and bins[i] > 5:
                priorities[i] = 5
            elif item > 6 and bins[i] > 4:
                priorities[i] = 4
            else:
                priorities[i] = 3
        elif ratios[i] > 0.7:
            if item > 5 and bins[i] > 3:
                priorities[i] = 4
            elif item > 3 and bins[i] > 2:
                priorities[i] = 3
            else:
                priorities[i] = 2
        elif ratios[i] > 0.5:
            if item > 2 and bins[i] > 1:
                priorities[i] = 3
            else:
                priorities[i] = 2
        else:
            if bins[i] >= 1:
                priorities[i] = 2
            else:
                priorities[i] = 0

    return priorities
